import cImg from '../Images/cat.jpg';
import eImg from '../Images/elephant.jpg'
import "./app.css";

export default function App() {
  function alertName(name,profession) {
    alert(`Hello my name is ${name} <br> and i'm a ${profession}`);
  }
  return (
    <div className="App">
      <Profile
        fullName="Lion"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={lImg}
        alertName={alertName}
      />
      <Profile
        fullName="Zebra"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={zImg}
        alertName={alertName}
      />
