        fullName="Cat"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={cImg}
        alertName={alertName}
      />
      <Profile
        fullName="Elephant"
        bio="bachelor degree in networking & telecommunications"
        profession="web developer"
        imge={eImg}
        alertName={alertName}
      />
    </div>
    );
}
